import React from 'react';
import { TextInput } from '../../textInput';

export const Workshop = ({ registration }) => {//Toma un valor booleano
    if (registration)//de ser true, se está dando el alta, de lo contrario, la baja
        return (
            <form>{/*Devuelve el form para dar de alta a un raller. Pide todos los datos necesarios*/}
                <TextInput name={'Name'} label={'Nombre'} />
                <textarea name='Contact' placeholder='Ingrese los datos del contacto...' />
            </form>
        );
    else
        return (
            <form>{/*Devuelve el form para dar de baja a un taller. Pide todos los datos necesarios*/}
                <TextInput name={'Name'} label={'Nombre'} />
            </form>
        );
}
